BEGIN TRANSACTION;
DROP TABLE IF EXISTS "seaql_migrations";
CREATE TABLE IF NOT EXISTS "seaql_migrations" (
	"version"	text NOT NULL,
	"applied_at"	integer NOT NULL,
	PRIMARY KEY("version")
);
DROP TABLE IF EXISTS "settings";
CREATE TABLE IF NOT EXISTS "settings" (
	"name"	text NOT NULL,
	"value"	text NOT NULL,
	PRIMARY KEY("name")
);
DROP TABLE IF EXISTS "songs";
CREATE TABLE IF NOT EXISTS "songs" (
	"id"	text NOT NULL,
	"path"	text NOT NULL UNIQUE,
	"title"	text NOT NULL,
	"artist"	text NOT NULL,
	"album_name"	text NOT NULL,
	"track"	integer,
	"disk"	integer,
	"codec"	text,
	"duration"	integer NOT NULL,
	"year"	integer,
	"label"	text,
	"sample_rate"	text,
	"bits_per_sample"	integer,
	"mb_recording_id"	text,
	"mb_artist_id"	text,
	"mb_track_id"	text,
	"created_at"	text NOT NULL,
	"updated_at"	text NOT NULL,
	"album_id"	text,
	"liked"	boolean NOT NULL,
	FOREIGN KEY("album_id") REFERENCES "albums"("id") ON DELETE SET NULL ON UPDATE CASCADE,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "albums";
CREATE TABLE IF NOT EXISTS "albums" (
	"id"	text NOT NULL,
	"path"	text NOT NULL,
	"name"	text NOT NULL,
	"artist_name"	text NOT NULL,
	"cover"	text,
	"album_description"	text,
	"year"	integer NOT NULL,
	"mb_artist_id"	text,
	"created_at"	text NOT NULL,
	"updated_at"	text NOT NULL,
	"artist_id"	text,
	FOREIGN KEY("artist_id") REFERENCES "artists"("id") ON DELETE SET NULL ON UPDATE CASCADE,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "artists";
CREATE TABLE IF NOT EXISTS "artists" (
	"id"	text NOT NULL,
	"name"	text NOT NULL UNIQUE,
	"image"	text,
	"bio"	text,
	"mb_artist_id"	text,
	"created_at"	text NOT NULL,
	"updated_at"	text NOT NULL,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "directories";
CREATE TABLE IF NOT EXISTS "directories" (
	"id"	text NOT NULL,
	"path"	text NOT NULL UNIQUE,
	"mtime"	text NOT NULL,
	"created_at"	text NOT NULL,
	"updated_at"	text NOT NULL,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "playlists";
CREATE TABLE IF NOT EXISTS "playlists" (
	"id"	text NOT NULL,
	"name"	text NOT NULL,
	"created_at"	text NOT NULL,
	"updated_at"	text NOT NULL,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "playlists_song";
CREATE TABLE IF NOT EXISTS "playlists_song" (
	"id"	text NOT NULL,
	"playlist_id"	text,
	"song_id"	text,
	FOREIGN KEY("song_id") REFERENCES "songs"("id") ON DELETE SET NULL ON UPDATE CASCADE,
	FOREIGN KEY("playlist_id") REFERENCES "playlists"("id") ON DELETE SET NULL ON UPDATE CASCADE,
	PRIMARY KEY("id")
);
DROP INDEX IF EXISTS "idx-albums-id";
CREATE INDEX IF NOT EXISTS "idx-albums-id" ON "albums" (
	"id"
);
DROP INDEX IF EXISTS "idx-songs-id";
CREATE INDEX IF NOT EXISTS "idx-songs-id" ON "songs" (
	"id"
);
DROP INDEX IF EXISTS "idx-artists-id";
CREATE INDEX IF NOT EXISTS "idx-artists-id" ON "artists" (
	"id"
);
DROP INDEX IF EXISTS "idx-directories-id";
CREATE INDEX IF NOT EXISTS "idx-directories-id" ON "directories" (
	"id"
);
DROP INDEX IF EXISTS "idx-artists-name";
CREATE INDEX IF NOT EXISTS "idx-artists-name" ON "artists" (
	"name"
);
DROP INDEX IF EXISTS "idx-albums-name";
CREATE INDEX IF NOT EXISTS "idx-albums-name" ON "albums" (
	"name"
);
DROP INDEX IF EXISTS "idx-songs-path";
CREATE INDEX IF NOT EXISTS "idx-songs-path" ON "songs" (
	"path"
);
COMMIT;
